  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this plan is to outline
  the current status of invasive weeds at the Don Edwards San Francisco Bay NWR Environmental
  Education Center and to provide a detailed plan of action to reduce and/or eradicate
  invasive weeds from the area. This plan promotes adaptive management concepts by
  evaluating different weed eradication techniques as they are implemented. Additionally,
  a monitoring protocol is described which will enable Refuge staff and volunteers
  to evaluate weed reduction techniques in relation to the objectives and facilitate
  adaptive management.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
